  const [formData, setFormData] = useState({
    categoryName: "", 
    restaurantId: ""
  })

  const handleInputChange = (event) => {
    const { name, value } = event.target;
    setFormData()
  }
  return (
    <div>
      <div>
        <h1>CreateCategory</h1>
        <form action="">
          <TextField
            label="category name"
            name='categoryName'
            value={formData.categoryName}
            onChange={handleInputChange}
            fullWidth
          />
        </form>
      </div>
    </div>
  )
}
